function object_size(obj) {
  var size = 0, key;
  for (key in obj) {
    if (obj.hasOwnProperty(key)) {
      size++;
    }
  }
  return size;
}

/**
 * sanitize a sting so it can be used as an object property key
 */
function sanitize_path(str) {
  var args = {
    '/': '--',
    '.': '-'
  };
  for (var key in args) {
    str = str.replace(key, args[key]);
  }
  return str;
}

